import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
// import Signup from './component/signup.component';

function App() {
  // const Form=()=>{
  //   console.log("Came");
  //   <Signup/>
  // }

  const Signup = () => {
    return (
        <div className='register'>
            <div className='form-floating'>
                <input className='form-control'></input>
                <label for="floatingInput">Email address</label>
            </div>
            <div className="form-floating mb-3">
                <input type="password" className="form-control" id="floatingInput" placeholder="password"></input>
                    <label for="floatingInput">Password</label>
            </div>
        </div>
    );
};
  return (
    <div className="App">
      <div className='row first d-flex flex-row-reverse py-3 px-4'>
        <button className='col-2 btn bg-white' onClick={Signup}>Login / Signup</button>
        <Signup/>
      </div>
    </div>
  )
}

export default App;
